import React, { Component } from "react";
class RadioInput extends Component {
  state = {};

  render() {
    return (
      <div>
        <label className="login_label" htmlFor="teacher">
          Teacher
        </label>
        &nbsp;&nbsp;
        <input
          type="radio"
          id="teacher"
          name="selection"
          value="teacher"
          onChange={this.handleChange}
        />
        &nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;
        <label className="login_label" htmlFor="admin">
          Admin
        </label>
        &nbsp;&nbsp;
        <input
          type="radio"
          id="admin"
          name="selection"
          value="admin"
          onChange={this.handleChange}
        />
        &nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;
        <label className="login_label" htmlFor="student">
          Student
        </label>
        &nbsp;&nbsp;
        <input
          type="radio"
          id="student"
          name="selection"
          value="student"
          onChange={this.handleChange}
        />
        <br></br>
        &nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;
        &nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;
        &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
        <label className="login_label" htmlFor="obecell">
          OBE Cell
        </label>
        &nbsp;&nbsp;
        <input
          type="radio"
          id="obecell"
          name="selection"
          value="obecell"
          onChange={this.handleChange}
        />
      </div>
    );
  }
}

export default RadioInput;
